              <td align="center">
                <a href={`/clients/${item.clientId}`}>
                  {" "}
                  <i className="fas fa-ellipsis-h" />
                </a>
              </td>
            </tr>
          ))} */}
        </tbody>
        <tfoot>{tableFootData}</tfoot>
      </table>
    </div>
  );
}

export default TableUtil;
